.notion-help-button {
	display: none !important;
}

/* ========== A few personal changes ========== */
.notion-page-view-discussion,
.notion-page-view-discussion + [style*='width: 100%; height: 1px;'] {
  display: none !important;
}
.notion-page-controls {
  margin-top: 0px !important
}
.notion-record-icon {
  margin-top: 0px !important;
}
.pseudoSelection > .notion-focusable.notranslate.notion-record-icon {
  margin-top: 20px !important;
}
.notion-sidebar {
  min-height: 86vh !important;
}
#enhancer--panel-header {
  background: #202020 !important;
}
#enhancer--panel {
  background: rgb(32, 32, 32)!important;
}
.outliner--header:hover {
  background: #202020 !important;
}

/* ========== Smaller page icons ========== */
/* Place icon relative to the title container */
.notion-scroller[style*="display: flex; flex-direction: column"] > :nth-child(2):not([contenteditable*="false"]) > :first-child {
    padding-top: 15px;
    position: relative;
}
/* Set icon size */
.notion-scroller[style*="display: flex; flex-direction: column"] > :nth-child(2):not([contenteditable*="false"]) > :first-child > :first-child .notion-record-icon[style *= "height: 140px"],
.notion-scroller[style*="display: flex; flex-direction: column"] > :nth-child(2):not([contenteditable*="false"]) > :first-child > :first-child .notion-record-icon[style *= "height: 78px"] {
    width: 38px !important;
    height: 38px !important;
}
.notion-scroller[style*="display: flex; flex-direction: column"] > :nth-child(2):not([contenteditable*="false"]) > :first-child > :first-child .notion-record-icon[style *= "height: 140px"] *, .notion-scroller[style*="display: flex; flex-direction: column"] > :nth-child(2):not([contenteditable*="false"]) > :first-child > :first-child .notion-record-icon[style *= "height: 78px"] * {
    width: 100% !important;
    height: 100% !important;
}
/* Icon placement */
.notion-scroller[style*="display: flex; flex-direction: column"] > :nth-child(2):not([contenteditable*="false"]) > :first-child > :first-child .notion-record-icon[style *= "height: 140px"],
.notion-scroller[style*="display: flex; flex-direction: column"] > :nth-child(2):not([contenteditable*="false"]) > :first-child > :first-child .notion-record-icon[style *= "height: 78px"] {
    margin-top: 4px !important;
    margin-right: 8px !important;
    float: left;
}
.notion-scroller[style*="display: flex; flex-direction: column"] > :nth-child(2):not([contenteditable*="false"]) > :first-child > :first-child .notion-page-controls {
    position: absolute !important;
    top: -5px;
}
/* Emoji icon */
.notion-scroller[style*="display: flex; flex-direction: column"] > :nth-child(2):not([contenteditable*="false"]) > :first-child > :first-child .notion-record-icon [style*="font-size: 78px"] {
    font-size: 38px !important;
}
/* Remove space on top of the page when no icon or cover is set  */
.notion-page-controls[style*="margin-top: 80px"] {
    margin-top: 8px !important;
}
.notion-page-controls[style*="margin-top: 32px"] {
    margin-top: 8px !important;
}

/* ========== Bigger icons in calendar view ========== */
.notion-calendar-view .notion-record-icon {
  width: 16px !important;
  height: 16px !important;
  margin-top: 0 !important;
}
.notion-calendar-view .notion-record-icon * {
  width: 100% !important;
  height: 100% !important;
}

/* ========== CENTRE-ALIGN TABLE COLUMN HEADERS ========== */
.notion-table-view-header-cell > div > div {
  margin: 0px auto;
}

/* ========== Fira math font ========== */
/* @import url("https://firamath.github.io/css/firamath.css");
.katex * {
  font-family: "Fira Math" !important;
}*/

/* ========== LEFT-ALIGN IMAGES ========== */
/*.notion-selectable.notion-image-block {
  margin-right: auto;
}*/


/* ========== CONDENSED BULLET POINTS ========== */
/*.notion-selectable.notion-bulleted_list-block {
  margin-top: -1.5px !important;
  margin-bottom: -1.5px !important;
}*/

/* ========== SHRINK PADDING ON CODE BLOCKS ========== */
.notion-code-block.line-numbers > div {
  padding-top: 14px !important;
  padding-bottom: 14px !important;
}
.notion-code-block:not(.line-numbers) .line-numbers + div + div, #code-line-numbers {
  top: 14px !important;
}
.notion-code-block.line-numbers + div + div {
  background: var(--theme--code-background);
  box-shadow: 5px 2px 8px 4px var(--theme--code-background);
}

/* ========== BRACKETED LINKS ========== */
.notion-link-token span {
  border-bottom: none !important;
}
.notion-link-token:before {
  content: '[[';
  opacity: 0.7;
  transition: opacity 100ms ease-in;
}
.notion-link-token:after {
  content: ']]';
  opacity: 0.7;
  transition: opacity 100ms ease-in;
}
.notion-link-token:hover::before,
.notion-link-token:hover::after {
  opacity: 1;
}

/* ========== SHARE ICON INSTEAD OF TEXT ========== */
.notion-topbar-share-menu {
	font-size: 0 !important;
}
.notion-topbar-share-menu:before  { 
	font-family: FontAwesome; 
	font-size: 15px;
	color: rgba(255, 255, 255, 0.81);
	display: inline-block; 
	content: '\f1e0';
}
@media (prefers-color-scheme: light) {
	.notion-topbar-share-menu:before  { 
		font-family: FontAwesome; 
		font-size: 15px;
		color: #55534ed4;
		display: inline-block; 
		content: '\f1e0';
	}
}

